import React, {useEffect} from 'react';
import './fullCart.css';
import ButtonPurchase from '../buttonPurchase/buttonPurchase';

function FullCart() {
    const [username, setUsername] = useState(undefined);
    if (!localStorage.authorization) {
        document.location = '/'
    } else {
        return (
            <div className="cart-container">
                <ButtonPurchase />
                <div className='products'>
                    <div className='products__one'>
                        <div className='book-nane'>
                            Book name
                        </div>
                        <div className='count'>
                            Count
                        </div>
                        <div className='price'>
                            Total price
                        </div>
                    </div>

                </div>
                <div className='total'>
                    Total price, $ 103
                </div>
            </div>

        )
    }
}

export default FullCart;
